import React, { Component } from "react";

class Mouse extends Component {
  state = {
    base: [
      {
        height: "70px",
        width: "70px",
        borderRadius: 300,
        border: "2px solid red",
        position: "absolute"
      }
    ]
  };
  render() {
    return (
      <div>
        <div>
          <div className="circle" style={this.state.base}></div>
        </div>
      </div>
    );
  }
}

export default Mouse;
